import * as React from 'react';

interface ScreenProps {
  isFocused?: boolean;
}

const screenStyles = {
  border: '1px solid #333',
  borderRadius: '4px',
  padding: '1rem',
};

export class Screen<P, S> extends React.PureComponent<P, S> {
  protected subject: string;

  protected componentWillReceiveProps() {
    this.forceUpdate();
  }

  protected renderScreen(): React.ReactNode {
    return undefined;
  }

  public render() {
    return (
      <section style={screenStyles} className={`section ${this.subject}`}>
        <div className='screen-header'>
          <h3>{ this.subject }</h3>
        </div>
        { this.renderScreen() }
      </section>
    )
  }
}

import * as React from 'react';

interface ButtonProps {
  subject?: string;
  styles?: object;
  enableEnterActivation?: boolean;
  onClick?: () => void;
}

const baseButtonStyles = {
  border: '1px solid #eee',
  borderRadius: '4px',
  padding: '.5rem',
};

export class Button extends React.Component<ButtonProps, {}> {
  constructor(props) {
    super(props);
  }

  public render() {
    const { children } = this.props;
    return (
      <div onClick={this.props.onClick} style={baseButtonStyles} className='button'>
        { children }
      </div>
    )
  }
}
